import React from 'react';
import './App.css';
import PlayerInfo from './component/PlayerInfo'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom'


function App() {

  return (
    <Router className="App">
      <Routes>
        <Route exact path='/player/info' element={< PlayerInfo />}></Route>
      </Routes>
    </Router>
  )
}

export default App;
